import React, { useState, useEffect } from 'react';
import axios from 'axios';

const ToDos = () => {

  const [todos, setTodos] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:8090/')
    .then(res => {
        setTodos(res.data.todos);
      })
      .catch(err => {alert(err)});
  }, [])

  return (
    <div>
      <table>
        <thead>
          <td>Todo</td>
        </thead>
        <tbody>
          {todos.map(todo => (
            <tr key={todo.id}>
              <td>{todo.text}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  )
}

export default ToDos
